import React from "react";
import logo from "../logo.svg";
import "../splash/splash.css";
export default function splash() {
  return (
    <div className="login-box">
      <img src={logo} alt="avatar" className="avatar" />
      <h1>Login Here</h1>
    </div>
  );
}
